import React from "react";

function NotebookHeader({setCurrentScreen}) {
  return (
    <nav className="notebook-header">
      <ul>
        <li>
          <a onClick={() => setCurrentScreen(PAGES.homepage)}>Site name</a>
        </li>
        <li>
          <a>Close</a>
        </li>
      </ul>
    </nav>
  );
}

export default NotebookHeader;
